(ns advent-of-code-2018.day05)

(def input "")

(defn opposite-polarity? [l r]
  (-> (- (int l) (int r)) Math/abs
      (- 32) ; subtract offset between small ASCII and capitals.
      zero?))

(defn solution1 [input]
  (loop [front (list)
         tail input]
    (if (empty? tail)
      (count front)
      (recur
        (if (or (empty? front)
                (not (opposite-polarity? (peek front) (first tail))))
          (conj front (first tail))
          (pop front))
        (rest tail)))))

(solution1 input)

(defn solution2 [input]
  (->> (for [c (range (int \A) (inc (int \Z)))
             :let [troublemaker #{(char c) (char (+ c 32))}]]
         (remove troublemaker input))
       (map solution1)
       (apply min)))

(solution2 input)
